Eleição para o cargo de Ministro do Tribunal de Contas da União, nos termos do art. 73º, § 2º, II, c/c art. 49º, XIII, da Constituição Federal.

Deputado Jhonatan de Jesus: 239 votos;
Deputado Fábio Ramalho: 174 votos;
Deputada Soraya Santos: 75 votos; 
Votos brancos: 5; 
Total:  493 votos válidos.

Vai ao Senado Federal o Projeto de Decreto Legislativo nº 2, de 2023, que "escolhe o Senhor Johnathan Pereira de Jesus para o cargo de Ministro do Tribunal de Contas da União, nos termos do art. 73, § 2º, inciso II, da Constituição Federal."
